import s from './Header.module.css'

function Header(){
    return(
        <header className={s.header}>
        <img src='logo.png'></img>
        </header>
    )
}
<a href="https://www.flaticon.com/ru/free-icons/" title="пирамида иконки">Пирамида иконки от Freepik - Flaticon</a>

export default Header;
